%[text] # Using uDALES utilities in MATLAB
%[text] This tutorial demonstrates how to use the uDALES MATLAB utilities for post-processing simulation data. It covers 1) time-averaging; 2) merging short-term time-averaged data to long-term averages, and 3) coarse-graining fields for Spatial filtering (coarse-graining method). The utility functions include:
%[text] - [**time\_average**](internal:M_8a7f). This method operates similarly to merge\_stat, but provide a more straightforward way to time-average variables over all available time intervals.
%[text] - [**merge\_stat**](internal:M_6c19)**.** This method merges the short-term time average and (co)variance into long-term averages and associated (co)variance.
%[text] - [**coarsegrain\_field**](internal:M_9e57)**.** This method allows you to coarse-grain a field using a planar filter in the x-y plane using a fixed lengthscale \[1\]. \
%%
%[text] %[text:anchor:M_8a7f] ## time\_average: time-averaged mean and variance of instantaneous data
%[text] `time_average` function returns the mean and variance of time-series data (fields, facets, timeseries, ...). The method assumes that time is the last array index.
help time_average %[output:2ddb6e58]
%[text] For example, let's load instantaneous pressure data for facets:
% preamble
clear variables
close all

% add the uDALES matlab path
addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')

% create an instance of the udbase class
expnr = 065;  % Experiment number
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\065';
sim = udbase(expnr, expdir);

p = sim.load_fac_momentum('pres');
t = sim.load_fac_momentum('t');
%[text] Now, let's calculate pressure mean and variance
[pav, pvar] = time_average(p);
%[text] Plot the time-series of $p$ together with the mean and the 95% confidence interval
figure %[output:71f26072]
plot(t, p(1,:), t, ones(size(t)) *pav(1),'k-'); hold on %[output:71f26072]
plot(t, ones(size(t)) *(pav(1)+ 2* sqrt(pvar(1))), 'k--', t, ones(size(t)) *(pav(1)- 2* sqrt(pvar(1))), 'k--') %[output:71f26072]
legend('p(t)', 'time-averaged p','two-sigma level of p') %[output:71f26072]
xlabel 'time'; ylabel 'pressure'; %[output:71f26072]
%[text] The function can also be used to calculated the time average and covariance of **two variables.** For example, let's calculate the covariance of the facet pressure and x-component shear stress $\\overline{p'\\tau\_x'}$:
taux = sim.load_fac_momentum('tau_x'); 
[pbar, tauxbar, ptauxbar] = time_average(p, taux);

% check output for the first facet
fprintf('The time-averaged pressure pbar=%.3f m2/s2, tauxbar=%.3f m2/s2 and their covariance p''taux''bar=%.3f m4/s4.\n', ... %[output:group:88af85c8] %[output:1e573817]
    pbar(1), tauxbar(1), ptauxbar(1)); %[output:group:88af85c8] %[output:1e573817]
%[text] The value of `pbar` returned by both methods is identical. Note that this example is quite exotic as we only had loaded facet data; more conventional covariances are $\\overline{w'u'}$, $\\overline{w'p'}$ etc.
%%
%[text] %[text:anchor:M_6c19] ## merge\_stat: combine short-term time average into a long-term time average 
%[text] uDALES statistics are collected over fixed time-windows. Sometimes these time windows may be a bit too short. The functions `merge_stat_var` and `merge_stat_cov` are able to combine several of time-windows into larger ones. 
%[text] Let's start with loading short-term time-averaged data, for example the 1-D plane average
% Use a different simulation
expnr = 110;  % Experiment number
expdir = 'C:\Users\mvr\OneDrive - Imperial College London\projects\2024_uDALES_sprint\udales-pp\experiments\110';
sim = udbase(expnr, expdir); %[output:148041ec]

% load xy- and time-averaged data
uxyt = sim.load_stat_xyt('uxyt');        % u-velocity profile (z) [m/s]
wxyt = sim.load_stat_xyt('wxyt');        % w-velocity profile [m/s]
upupxyt = sim.load_stat_xyt('upuptxyc'); % u-velocity variance [m²/s²]
upwpxyt = sim.load_stat_xyt('upwpxyt');  % u-w velocity covariance [m²/s²]
time = sim.load_stat_xyt('time');        % Time coordinate for xyt data [s]
%[text] Check the averaging time interval
time %[output:2662b56c]
length(time) %[output:1d5ab3f2]
%[text] So there are three time-averaging intervals. Long-term time averaging can be used by using
help merge_stat %[text:anchor:M_348c] %[output:2ccd135c]
%[text] This function needs all the short-term variables related as the input, plus an average time window. The long-term average is simply the average of the short-term averages, but the long-terms variance contains both contribution from variance in the short-term mean and the short term variance. Please ensure that the last dimension of the input must be the time, as the function merges on that dimension.
%[text] Let's start with **two variables and their covariance**, obtaining long-term quantities for $\\overline u$, $\\bar{w}${"editStyle":"visual"} and their covariance $\\overline{u'w'}$ over all three time segments:
Nwindow = length(time);

% input all the short-term variables related
[uxyt_longterm, wxyt_longterm, upwpxyt_longterm] = merge_stat(uxyt, wxyt, upwpxyt, Nwindow);
%[text] if you only need **one variable**, e.g., the long-term quantities for $\\overline u$ and $\\overline{u'u'}$ over all time, you can reduce it to:
[uxyt_longterm, upupxyt_longterm] = merge_stat(uxyt, upupxyt, Nwindow);
%[text] Naturally both versions return the same value for `uxyt_longterm.` Let's check the dimension of the short-term and long-term statistics
size(uxyt) %[output:7237e1c7]
size(uxyt_longterm) %[output:38df4d3b]
%[text] If you want an average over shorter window, you can an optional parameter to `merge_stat`::
Nwindow = 2;
[uxyt_longterm, upupxyt_longterm] = merge_stat(uxyt, upupxyt, Nwindow);

size(uxyt_longterm) %[output:882f9c11]
%[text] There were three intervals in uxut, and the last two were used to average over. The first time-interval has been discarded.
%%
%[text] %[text:anchor:M_9e57] ## coarsegrain\_field: coarse-graining 3D fields
%[text] We recently developed a coarse-graining method that is computationally efficient and can be used to coarse-grain data \[1\]. In order to demonstrate its use, let's load the mean horizontal velocity $\\overline{u}$ from the uDALES data.
ut = sim.load_stat_t('ut');
%[text] The coarse-graining routine has the following syntax:
help coarsegrain_field %[output:4a6d0b86]
%[text] The routine takes in multiple filter lengths simultaneously.
filter_lengths = [8 32 128];  % Filter widths in meters

% filter the last field
u_filtered = coarsegrain_field(ut(:,:,:,end), filter_lengths, sim.xm, sim.ym); %[output:22e30d01]
% Create figure with subplots comparing original and filtered fields

figure %[output:208cede6]
k_level = 10;
% Original field (unfiltered)
subplot(2,2,1) %[output:208cede6]
pcolor(sim.xt, sim.yt, ut(:,:,k_level)');  %[output:208cede6]
shading flat; axis equal tight; colorbar;  %[output:208cede6]
clim([-1 2]) %[output:208cede6]
title('Original Field (Unfiltered)') %[output:208cede6]
xlabel('x [m]'); ylabel('y [m]'); %[output:208cede6]

% Filtered fields with increasing filter lengths
filter_titles = {
    sprintf('Filter Length = %.0f m', filter_lengths(1)),
    sprintf('Filter Length = %.0f m', filter_lengths(2)), 
    sprintf('Filter Length = %.0f m', filter_lengths(3))
};

for i = 1:3 %[output:group:8539b20b]
    subplot(2,2,i+1) %[output:208cede6]
    pcolor(sim.xt, sim.yt, u_filtered(:,:,k_level,i)'); 
    shading flat; axis equal tight; colorbar; 
    clim([-1 2])
    title(filter_titles{i})
    xlabel('x [m]'); ylabel('y [m]');
end %[output:group:8539b20b]
%%
%[text] ## References
%[text] \[1\] Maarten van Reeuwijk, Jingzi Huang (2025) Multi-scale Analysis of Flow over Heterogeneous Urban Environments, *Bound-Lay. Met.* **191**, 47.

